import Header from './Header';

const layoutStyle = {
  margin: 20,
  padding: 20,
  // border: '1px solid #DDD',
  // color: 'red'
};

const Layout = props => (
  <div style={layoutStyle}>
    <Header />
    <ul class="cb-slideshow">
	<li>
		<span>Image 01</span>
		<div>
			<h3>re·lax·a·tion</h3>
		</div>
	</li>

</ul>
    {props.children}
  </div>
);

export default Layout;
